import React from 'react';

const AboutMe = () => {
    return (
        <div className='about-me-page'>
            <h2 className='heading'>About Me</h2>
            <p>Hello!</p>
            <p>This is a little website I built for myself. I was tired of shooting off boring emails</p>
            <p>with my resume attached as a PDF. SO 20th century!</p>
            <p>So here's a space where you can find all of the necessary information about me,</p>
            <p>but in a much nicer, interactive way!</p>
        </div>
    )
}

export default AboutMe;
